    false,nt"url": null,nt"notes": "This data set contains ortho-rectified
    mosaic tiles, created as a product from the NOAA Integrated Ocean and Coastal Mapping
    (IOCM) initiative of Lake Charles, Louisiana. The source imagery was acquired on
    November 23, 2009 and March 12, 2010. The true color images were acquired with an
    Applanix Digital Sensor System (DSS). The ground sample distance (GSD) for each
    pixel is 0.35 m. The original images were acquired at a higher resolution than the
    final ortho-rectified mosaic. Ortho-rectified mosaic tiles are an ancillary product
    of NOAA's Coastal Mapping Program (CMP), created through a wider Integrated Ocean
    and Coastal Mapping initiative to increase support for multiple uses of the data.nnThese
    data are .tif files with associated files and Federal Geographic Data Committee
    (FGDC) metadata. Infrared (IR) orthoimagery for this region is archived at the NODC
    under accession number 0100232.",nt"license_title": null,nt"extras": [{ntt"key":
